import {
  Stack,
  Drawer,
  AppBar,
  Toolbar,
  IconButton,
  MenuIcon
} from "@mui/material";
import DashboardIcon from '@mui/icons-material/Dashboard';
let width=250;
const Admin = ()=>{
  const design = (
    <>
      <h1>Helo</h1>
      <Stack>
        <Drawer variant="permanent"
        sx={{
          width:width,
          "& .MuiDrawer-paper":{
            width: width,
            bgcolor: "#f5f5f5"
          }
        }}
        >
        <DashboardIcon />
        </Drawer>
        <AppBar>
        </AppBar>
      </Stack>
    </>
  );
  return design;
}
export default Admin;
